ercent\', wf_requiredApprovePercent);\n                     </activiti:string>\n                  </activiti:field>\n            </activiti:executionListener>\n        </extensionElements>\n        \n        <startEvent id=\"start\"\n            activiti:formKey=\"wf:submitGroupReviewTask\" />\n        \n			\n        <sequenceFlow id=\'flow1\' \n            sourceRef=\'start\'\n            targetRef=\'reviewTask\'>\n            <!-- TODO: Once multiInstanceLoopCharacteristics support using expression as loopDataInputRef, remove \'wf_groupMembers\' variable  -->\n            <extensionElements>\n	             <activiti:executionListener event=\"start\" class=\"org.alfresco.repo.workflow.activiti.listener.ScriptExecutionListener\">\n	        		<activiti:field name=\"script\">\n	                     <activiti:string>\n	                        var members = people.getMembers(bpm_groupAssignee);\n	                        var memberNames = new java.util.ArrayList();\n	                        \n	                        for(var i in members) \n                           {\n	                            memberNames.add(members[i].properties.userName);\n	                        }\n	                       	execution.setVariable(\'wf_groupMembers\', memberNames);\n	                        execution.setVariable(\'wf_reviewerCount\', memberNames.size());\n	                     </activiti:string>\n	                  </activiti:field>\n	            </activiti:executionListener>\n	         </extensionElements>\n        </sequenceFlow>\n\n        <userTask id=\"reviewTask\" name=\"Review Task\"\n            activiti:formKey=\"wf:activitiReviewTask\">\n           <extensionElements>\n               <activiti:taskListener event=\"create\" class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\n                  <activiti:field name=\"script\">\n                     <activiti:string>\n                        if (typeof bpm_workflowDueDate != \'undefined\') task.dueDate = bpm_workflowDueDate\n                        if (typeof bpm_workflowPriority != \'undefined\') task.priority = bpm_workflowPriority;\n                     </activiti:string>\n                  </activiti:field>\n               </activiti:taskListener>\n               <activiti:taskListener event=\"complete\" class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\n                  <activiti:field name=\"script\">\n                     <activiti:string>\n                        if(task.getVariableLocal(\'wf_reviewOutcome\') == \'Approve\') {\n                            var newApprovedCount = wf_approveCount + 1;\n	                         var newApprovedPercentage = (newApprovedCount / wf_reviewerCount) * 100;\n	                         \n	                         execution.setVariable(\'wf_approveCount\', newApprovedCount);\n	                         execution.setVariable(\'wf_actualPercent\', newApprovedPercentage);\n                        } else {\n                            var newRejectCount = wf_rejectCount + 1;\n                            var newRejectPercentage = (newRejectCount / wf_reviewerCount) * 100;\n                            \n                            execution.setVariable(\'wf_rejectCount\', newRejectCount);\n                            execution.setVariable(\'wf_actualRejectPercent\', newRejectPercentage);\n                        }\n                     </activiti:string>\n                  </activiti:field>\n               </activiti:taskListener>\n           </extensionElements>\n           \n           <humanPerformer>\n                <resourceAssignmentExpression>\n                    <formalExpression>${reviewAssignee}</formalExpression>\n                </resourceAssignmentExpression>\n           </humanPerformer>\n           \n           <!-- For each assignee, task is created -->\n           <multiInstanceLoopCharacteristics isSequential=\"false\">\n           	  <loopDataInputRef>wf_groupMembers</loopDataInputRef>\n           	  <inputDataItem name=\"reviewAssignee\" />\n           	  <completionCondition>${wf_actualPercent >= wf_requiredApprovePercent || wf_requiredApprovePercent > (100 - wf_actualRejectPercent)}</completionCondition>\n           </multiInstanceLoopCharacteristics>\n        </userTask>\n\n        <sequenceFlow id=\'flow2\' \n        	sourceRef=\'reviewTask\'\n            targetRef=\'reviewDecision\' />\n\n        <exclusiveGateway  id=\"reviewDecision\" name=\"Review Decision\" /> \n\n        <sequenceFlow id=\'flow3\' sourceRef=\'reviewDecision\' targetRef=\'approved\' >\n            <conditionExpression xsi:type=\"tFormalExpression\">${wf_actualPercent >= wf_requiredApprovePercent}</conditionExpression>\n        </sequenceFlow>\n\n        <sequenceFlow id=\'flow4\' \n        sourceRef=\'reviewDecision\'\n            targetRef=\'rejected\' />\n\n       <userTask id=\"approved\" name=\"Document Approved\"\n            activiti:formKey=\"wf:approvedParallelTask\" >\n            <documentation>\n                The document was reviewed and approved.\n            </documentation>\n            <extensionElements>\n               <activiti:taskListener event=\"create\" class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\n                  <activiti:field name=\"script\">\n                     <activiti:string>\n                        if (typeof bpm_workflowDueDate != \'undefined\') task.dueDate = bpm_workflowDueDate\n                        if (typeof bpm_workflowPriority != \'undefined\') task.priority = bpm_workflowPriority;\n                        \n                        // Set parallel review params on task, to be kept in history\n                        task.setVariableLocal(\'wf_reviewerCount\', wf_reviewerCount);\n                        task.setVariableLocal(\'wf_requiredPercent\', wf_requiredPercent);\n                        task.setVariableLocal(\'wf_actualPercent\', wf_actualPercent);\n                        task.setVariableLocal(\'wf_approveCount\', wf_approveCount);\n                        task.setVariableLocal(\'wf_rejectCount\', wf_rejectCount);\n                        task.setVariableLocal(\'wf_actualRejectPercent\', wf_actualRejectPercent);\n                     </activiti:string>\n                  </activiti:field>\n               </activiti:taskListener>\n            </extensionElements>\n            <humanPerformer>\n                <resourceAssignmentExpression>\n                    <formalExpression>${initiator.exists() ? initiator.properties.userName : \'admin\'}</formalExpression>\n                </resourceAssignmentExpression>\n            </humanPerformer>\n        </userTask>\n        \n        <userTask id=\"rejected\" name=\"Document Rejected\"\n            activiti:formKey=\"wf:rejectedParallelTask\" >\n            <documentation>\n                The document was reviewed and rejected.\n            </documentation>\n            <extensionElements>\n               <activiti:taskListener event=\"create\" class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\n                  <activiti:field name=\"script\">\n                     <activiti:string>\n                        if (typeof bpm_workflowDueDate != \'undefined\') task.dueDate = bpm_workflowDueDate\n                        if (typeof bpm_workflowPriority != \'undefined\') task.priority = bpm_workflowPriority;\n                        \n                        // Set parallel review params on task, to be kept in history\n                        task.setVariableLocal(\'wf_reviewerCount\', wf_reviewerCount);\n                        task.setVariableLocal(\'wf_requiredPercent\', wf_requiredPercent);\n                        task.setVariableLocal(\'wf_actualPercent\', wf_actualPercent);\n                        task.setVariableLocal(\'wf_approveCount\', wf_approveCount);\n                        task.setVariableLocal(\'wf_rejectCount\', wf_rejectCount);\n                        task.setVariableLocal(\'wf_actualRejectPercent\', wf_actualRejectPercent);\n                     </activiti:string>\n                  </activiti:field>\n               </activiti:taskListener>\n            </extensionElements>\n            <humanPerformer>\n                <resourceAssignmentExpression>\n                    <formalExpression>${initiator.exists() ? initiator.properties.userName : \'admin\'}</formalExpression>\n                </resourceAssignmentExpression>\n            </humanPerformer>\n        </userTask>\n\n        <sequenceFlow id=\'flow5\' sourceRef=\'approved\'\n            targetRef=\'end\' />\n\n        <sequenceFlow id=\'flow6\' sourceRef=\'rejected\'\n            targetRef=\'end\' />\n\n        <endEvent id=\"end\" />\n\n    </process>\n\n   <!-- Graphical representaion of diagram -->\n   <bpmndi:BPMNDiagram id=\"BPMNDiagram_activitiParallelGroupReview\">\n      <bpmndi:BPMNPlane bpmnElement=\"activitiParallelGroupReview\"\n         id=\"BPMNPlane_activitiParallelGroupReview\">\n         <bpmndi:BPMNShape bpmnElement=\"start\"\n            id=\"BPMNShape_start\">\n            <omgdc:Bounds height=\"35\" width=\"35\" x=\"30\" y=\"200\"></omgdc:Bounds>\n         </bpmndi:BPMNShape>\n         <bpmndi:BPMNShape bpmnElement=\"reviewTask\"\n            id=\"BPMNShape_reviewTask\">\n            <omgdc:Bounds height=\"55\" width=\"105\" x=\"125\"\n               y=\"190\"></omgdc:Bounds>\n         </bpmndi:BPMNShape>\n         <bpmndi:BPMNShape bpmnElement=\"reviewDecision\"\n            id=\"BPMNShape_reviewDecision\">\n            <omgdc:Bounds height=\"40\" width=\"40\" x=\"290\" y=\"197\"></omgdc:Bounds>\n         </bpmndi:BPMNShape>\n         <bpmndi:BPMNShape bpmnElement=\"approved\"\n            id=\"BPMNShape_approved\">\n            <omgdc:Bounds height=\"55\" width=\"105\" x=\"390\"\n               y=\"97\"></omgdc:Bounds>\n         </bpmndi:BPMNShape>\n         <bpmndi:BPMNShape bpmnElement=\"rejected\"\n            id=\"BP