ss\">\r\n\r\n        <startEvent id=\"start\"\r\n            activiti:formKey=\"wf:submitAdhocTask\" />\r\n        <sequenceFlow id=\'flow1\' \r\n            sourceRef=\'start\'\r\n            targetRef=\'adhocTask\' />\r\n\r\n        <userTask id=\"adhocTask\" name=\"Adhoc Task\"\r\n            activiti:formKey=\"wf:adhocTask\">\r\n           <extensionElements>\r\n               <activiti:taskListener event=\"create\" class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\r\n                  <activiti:field name=\"script\">\r\n                     <activiti:string>\r\n                      if (typeof bpm_workflowDueDate != \'undefined\') task.dueDate = bpm_workflowDueDate\r\n                      if (typeof bpm_workflowPriority != \'undefined\') task.priority = bpm_workflowPriority;\r\n                     </activiti:string>\r\n                  </activiti:field>\r\n               </activiti:taskListener>\r\n           </extensionElements>\r\n            <humanPerformer>\r\n                <resourceAssignmentExpression>\r\n                    <formalExpression>${bpm_assignee.properties.userName}</formalExpression>\r\n                </resourceAssignmentExpression>\r\n            </humanPerformer>\r\n        </userTask>\r\n\r\n        <sequenceFlow id=\'flow2\' \r\n        sourceRef=\'adhocTask\'\r\n            targetRef=\'verifyTaskDone\' />\r\n\r\n        <userTask id=\"verifyTaskDone\" name=\"Verify Adhoc Task Completed.\"\r\n            activiti:formKey=\"wf:completedAdhocTask\" >\r\n            <documentation>\r\n                Verify the arbitrary task was completed.\r\n            </documentation>\r\n            <extensionElements>\r\n               <activiti:taskListener event=\"create\" class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\r\n                  <activiti:field name=\"script\">\r\n                     <activiti:string>\r\n                        if (typeof bpm_workflowDueDate != \'undefined\') task.dueDate = bpm_workflowDueDate\r\n                        if (typeof bpm_workflowPriority != \'undefined\') task.priority = bpm_workflowPriority;\r\n                        \r\n                        if (wf_notifyMe)\r\n			            {\r\n			               var mail = actions.create(\"mail\");\r\n			               mail.parameters.to = initiator.properties.email;\r\n			               mail.parameters.subject = \"Adhoc Task \" + bpm_workflowDescription;\r\n			               mail.parameters.from = bpm_assignee.properties.email;\r\n			               mail.parameters.text = \"It\'s done\";\r\n			               mail.execute(bpm_package);\r\n			            }\r\n                     </activiti:string>\r\n                  </activiti:field>\r\n               </activiti:taskListener>\r\n           </extensionElements>\r\n            <humanPerformer>\r\n                <resourceAssignmentExpression>\r\n                    <formalExpression>${initiator.exists() ? initiator.properties.userName : \'admin\'}</formalExpression>\r\n                </resourceAssignmentExpression>\r\n            </humanPerformer>\r\n        </userTask>\r\n\r\n        <sequenceFlow id=\'flow3\' sourceRef=\'verifyTaskDone\'\r\n            targetRef=\'theEnd\' />\r\n\r\n        <endEvent id=\"theEnd\" />\r\n\r\n   </process>\r\n\r\n   <!-- Graphical representaion of diagram -->\r\n   <bpmndi:BPMNDiagram id=\"BPMNDiagram_activitiAdhoc\">\r\n      <bpmndi:BPMNPlane bpmnElement=\"activitiAdhoc\" id=\"BPMNPlane_activitiAdhoc\">\r\n         <bpmndi:BPMNShape bpmnElement=\"start\"\r\n            id=\"BPMNShape_start\">\r\n            <omgdc:Bounds height=\"35\" width=\"35\" x=\"30\" y=\"200\"></omgdc:Bounds>\r\n         </bpmndi:BPMNShape>\r\n         <bpmndi:BPMNShape bpmnElement=\"adhocTask\"\r\n            id=\"BPMNShape_adhocTask\">\r\n            <omgdc:Bounds height=\"55\" width=\"105\" x=\"130\"\r\n               y=\"190\"></omgdc:Bounds>\r\n         </bpmndi:BPMNShape>\r\n         <bpmndi:BPMNShape bpmnElement=\"verifyTaskDone\"\r\n            id=\"BPMNShape_verifyTaskDone\">\r\n            <omgdc:Bounds height=\"55\" width=\"105\" x=\"290\"\r\n               y=\"190\"></omgdc:Bounds>\r\n         </bpmndi:BPMNShape>\r\n         <bpmndi:BPMNShape bpmnElement=\"theEnd\"\r\n            id=\"BPMNShape_theEnd\">\r\n            <omgdc:Bounds height=\"35\" width=\"35\" x=\"455\" y=\"200\"></omgdc:Bounds>\r\n         </bpmndi:BPMNShape>\r\n         <bpmndi:BPMNEdge bpmnElement=\"flow1\" id=\"BPMNEdge_flow1\">\r\n            <omgdi:waypoint x=\"65\" y=\"217\"></omgdi:waypoint>\r\n            <omgdi:waypoint x=\"130\" y=\"217\"></omgdi:waypoint>\r\n         </bpmndi:BPMNEdge>\r\n         <bpmndi:BPMNEdge bpmnElement=\"flow2\" id=\"BPMNEdge_flow2\">\r\n            <omgdi:waypoint x=\"235\" y=\"217\"></omgdi:waypoint>\r\n            <omgdi:waypoint x=\"290\" y=\"217\"></omgdi:waypoint>\r\n         </bpmndi:BPMNEdge>\r\n         <bpmndi:BPMNEdge bpmnElement=\"flow3\" id=\"BPMNEdge_flow3\">\r\n            <omgdi:waypoint x=\"395\" y=\"217\"></omgdi:waypoint>\r\n            <omgdi:waypoint x=\"455\" y=\"217\"></omgdi:waypoint>\r\n         </bpmndi:BPMNEdge>\r\n      </bpmndi:BPMNPlane>\r\n   </bpmndi:BPMNDiagram>\r\n\r\n</definitions>',0),('22',1,'e5716695-85dd-4dea-8bd3-d04d6836be17bpmn20.xml','21','<definitions xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\r\n   xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:activiti=\"http://activiti.org/bpmn\"\r\n   xmlns:bpmndi=\"http://www.omg.org/spec/BPMN/20100524/DI\" xmlns:omgdc=\"http://www.omg.org/spec/DD/20100524/DC\"\r\n   xmlns:omgdi=\"http://www.omg.org/spec/DD/20100524/DI\" typeLanguage=\"http://www.w3.org/2001/XMLSchema\"\r\n   expressionLanguage=\"http://www.w3.org/1999/XPath\" targetNamespace=\"http://alfresco.org\">\r\n\r\n   <process isExecutable=\"true\" id=\"activitiInvitationModerated\" name=\"Moderated activiti invitation process\">\r\n\r\n      <startEvent id=\"start\" activiti:formKey=\"imwf:moderatedInvitationSubmitTask\" />\r\n\r\n      <sequenceFlow id=\"flow1\" sourceRef=\"start\" targetRef=\"reviewTask\" />\r\n\r\n      <userTask id=\"reviewTask\" name=\"Review Task\"\r\n         activiti:formKey=\"imwf:activitiModeratedInvitationReviewTask\">\r\n         <extensionElements>\r\n            <activiti:taskListener event=\"create\"\r\n               class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\r\n               <activiti:field name=\"script\">\r\n                  <activiti:string>\r\n                     if (typeof bpm_workflowDueDate != \'undefined\')\r\n                        task.setVariable(\'bpm_dueDate\', bpm_workflowDueDate);\r\n                     if (typeof bpm_workflowPriority != \'undefined\') \r\n                        task.priority = bpm_workflowPriority;\r\n                     </activiti:string>\r\n               </activiti:field>\r\n            </activiti:taskListener>\r\n            <activiti:taskListener event=\"complete\" class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\r\n               <activiti:field name=\"script\">\r\n                  <activiti:string>\r\n                     execution.setVariable(\'imwf_reviewOutcome\', task.getVariable(\'imwf_reviewOutcome\'));\r\n                     execution.setVariable(\'imwf_reviewer\', person.properties.userName);\r\n                  </activiti:string>\r\n               </activiti:field>\r\n            </activiti:taskListener>\r\n         </extensionElements>\r\n         <potentialOwner>\r\n            <resourceAssignmentExpression>\r\n               <formalExpression>${bpm_groupAssignee}</formalExpression>\r\n            </resourceAssignmentExpression>\r\n         </potentialOwner>\r\n      </userTask>\r\n      \r\n      <sequenceFlow id=\"flow2\" sourceRef=\"reviewTask\" targetRef=\"reviewDecision\" />\r\n\r\n      <exclusiveGateway id=\"reviewDecision\" name=\"Review Decision\" /> \r\n\r\n      <sequenceFlow id=\"flow3\" sourceRef=\"reviewDecision\" targetRef=\"approved\">\r\n          <conditionExpression xsi:type=\"tFormalExpression\">${imwf_reviewOutcome==\'approve\'}</conditionExpression>\r\n      </sequenceFlow>\r\n      \r\n      <serviceTask id=\"approved\" name=\"Approved\" activiti:delegateExpression=\"${ApproveModeratedInviteDelegate}\" />\r\n      <sequenceFlow id=\"flow5\" sourceRef=\"approved\" targetRef=\"end\" />\r\n\r\n      <sequenceFlow id=\"flow4\" sourceRef=\"reviewDecision\" targetRef=\"rejected\" />\r\n\r\n      <serviceTask id=\"rejected\" name=\"Rejected\" activiti:delegateExpression=\"${RejectModeratedInviteDelegate}\" />\r\n      <sequenceFlow id=\'flow6\' sourceRef=\'rejected\' targetRef=\'end\' />\r\n      \r\n      <endEvent id=\"end\" />\r\n   </process>\r\n\r\n</definitions>',0),('25',1,'a7950b41-5aa2-4804-869e-9c3a08bd68acbpmn20.xml','24','<definitions xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\r\n   xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:activiti=\"http://activiti.org/bpmn\"\r\n   xmlns:bpmndi=\"http://www.omg.org/spec/BPMN/20100524/DI\" xmlns:omgdc=\"http://www.omg.org/spec/DD/20100524/DC\"\r\n   xmlns:omgdi=\"http://www.omg.org/spec/DD/20100524/DI\" typeLanguage=\"http://www.w3.org/2001/XMLSchema\"\r\n   expressionLanguage=\"http://www.w3.org/1999/XPath\" targetNamespace=\"http://alfresco.org\">\r\n\r\n   <process isExecutable=\"true\" id=\"activitiInvitationNominated\" name=\"Nominated activiti invitation process\">\r\n\r\n      <startEvent id=\"start\" activiti:formKey=\"inwf:inviteToSiteTask\" />\r\n\r\n      <sequenceFlow id=\"flow1\" sourceRef=\"start\" targetRef=\"sendInvite\" />\r\n      \r\n      <serviceTask id=\"sendInvite\" name=\"Send Invite\" activiti:delegateExpression=\"${SendNominatedInviteDelegate}\" />\r\n      \r\n      <sequenceFlow id=\"flow2\" sourceRef=\"sendInvite\" targetRef=\"invitePending\" />\r\n\r\n      <userTask id=\"invitePending\" name=\"Invite Pending\"\r\n         activiti:formKey=\"inwf:activitiInvitePendingTask\">\r\n         <extensionElements>\r\n            <activiti:taskListener event=\"create\"\r\n               class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\r\n               <activiti:field name=\"script\">\r\n                  <activiti:string>\r\n                     if (typeof bpm_workflowDueDate != \'undefined\')\r\n                        task.setVariable(\'bpm_dueDate\', bpm_workflowDueDate);\r\n                     if (typeof bpm_workflowPriority != \'undefined\') \r\n                        task.priority = bpm_workflowPriority;\r\n                     </activiti:string>\r\n               </activiti:field>\r\n            </activiti:taskListener>\r\n            <activiti:taskListener event=\"complete\" class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\r\n               <activiti:field name=\"script\">\r\n                  <activiti:string>\r\n                     execution.setVariable(\'inwf_inviteOutcome\', task.getVariable(\'inwf_inviteOutcome\'));\r\n                  </activiti:string>\r\n               </activiti:field>\r\n            </activiti:taskListener>\r\n         </extensionElements>\r\n         <humanPerformer>\r\n            <resourceAssignmentExpression>\r\n                <formalExpression>${bpm_assignee.properties.userName}</formalExpression>\r\n            </resourceAssignmentExpression>\r\n         </humanPerformer>\r\n      </userTask>\r\n      \r\n      <sequenceFlow id=\"flow3\" sourceRef=\"invitePending\" targetRef=\"inviteGateway\" />\r\n\r\n      <exclusiveGateway id=\"inviteGateway\" name=\"Invite Gateway\" /> \r\n\r\n      <sequenceFlow id=\"flow4\" sourceRef=\"inviteGateway\" targetRef=\"accepted\">\r\n          <conditionExpression xsi:type=\"tFormalExpression\">${inwf_inviteOutcome == \'accept\'}</conditionExpression>\r\n      </sequenceFlow>\r\n      \r\n      <sequenceFlow id=\"flow5\" sourceRef=\"inviteGateway\" targetRef=\"rejected\">\r\n          <conditionExpression xsi:type=\"tFormalExpression\">${inwf_inviteOutcome == \'reject\'}</conditionExpression>\r\n      </sequenceFlow>\r\n      \r\n      <sequenceFlow id=\"flow7\" sourceRef=\"inviteGateway\" targetRef=\"cancelled\" />\r\n      \r\n      <serviceTask id=\"accepted\" name=\"Accepted\" activiti:delegateExpression=\"${AcceptNominatedInviteDelegate}\" />\r\n      <sequenceFlow id=\"flow6\" sourceRef=\"accepted\" targetRef=\"inviteAccepted\" />\r\n\r\n      <serviceTask id=\"rejected\" name=\"Rejected\" activiti:delegateExpression=\"${RejectNominatedInviteDelegate}\" />\r\n      <sequenceFlow id=\"flow8\" sourceRef=\"rejected\" targetRef=\"inviteRejected\" />\r\n      \r\n      <serviceTask id=\"cancelled\" name=\"Cancelled\" activiti:delegateExpression=\"${CancelNominatedInviteDelegate}\" />\r\n      <sequenceFlow id=\"flow9\" sourceRef=\"cancelled\" targetRef=\"end\" />\r\n      \r\n       <userTask id=\"inviteAccepted\" name=\"Invitation Accepted\"\r\n            activiti:formKey=\"inwf:acceptInviteTask\" >\r\n            <extensionElements>\r\n               <activiti:taskListener event=\"create\" class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\r\n                  <activiti:field name=\"script\">\r\n                     <activiti:string>\r\n                        if (typeof bpm_workflowPriority != \'undefined\') task.priority = bpm_workflowPriority;\r\n                     </activiti:string>\r\n                  </activiti:field>\r\n               </activiti:taskListener>\r\n            </extensionElements>\r\n            <humanPerformer>\r\n                <resourceAssignmentExpression>\r\n                    <formalExpression>${initiator.exists() ? initiator.properties.userName : \'admin\'}</formalExpression>\r\n                </resourceAssignmentExpression>\r\n            </humanPerformer>\r\n        </userTask>\r\n\r\n      <sequenceFlow id=\"flow10\" sourceRef=\"inviteAccepted\" targetRef=\"end\" />\r\n        \r\n       <userTask id=\"inviteRejected\" name=\"Invitation Rejected\"\r\n            activiti:formKey=\"inwf:rejectInviteTask\" >\r\n            <extensionElements>\r\n               <activiti:taskListener event=\"create\" class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\r\n                  <activiti:field name=\"script\">\r\n                     <activiti:string>\r\n                        if (typeof bpm_workflowPriority != \'undefined\') task.priority = bpm_workflowPriority;\r\n                     </activiti:string>\r\n                  </activiti:field>\r\n               </activiti:taskListener>\r\n            </extensionElements>\r\n            <humanPerformer>\r\n                <resourceAssignmentExpression>\r\n                    <formalExpression>${initiator.exists() ? initiator.properties.userName : \'admin\'}</formalExpression>\r\n                </resourceAssignmentExpression>\r\n            </humanPerformer>\r\n        </userTask>\r\n        \r\n              <sequenceFlow id=\"flow11\" sourceRef=\"inviteRejected\" targetRef=\"end\" />\r\n        \r\n      <endEvent id=\"end\" />\r\n   </process>\r\n\r\n</definitions>',0),('28',1,'2c25dd00-f984-44aa-b224-e39b70188c7dbpmn20.xml','27','<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\r\n\r\n<definitions xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\r\n   xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:activiti=\"http://activiti.org/bpmn\"\r\n   xmlns:bpmndi=\"http://www.omg.org/spec/BPMN/20100524/DI\" xmlns:omgdc=\"http://www.omg.org/spec/DD/20100524/DC\"\r\n   xmlns:omgdi=\"http://www.omg.org/spec/DD/20100524/DI\" typeLanguage=\"http://www.w3.org/2001/XMLSchema\"\r\n   expressionLanguage=\"http://www.w3.org/1999/XPath\" targetNamespace=\"http://alfresco.org\">\r\n\r\n    <process isExecutable=\"true\" id=\"publishWebContent\" name=\"Publish Web Content Activiti Process\">\r\n\r\n        <startEvent id=\"start\"\r\n            activiti:formKey=\"pubwf:startPublish\" />\r\n        \r\n        <sequenceFlow id=\'flow0\' \r\n            sourceRef=\'start\'\r\n            targetRef=\'startWait\' />\r\n            \r\n        <receiveTask id=\"startWait\" name=\"Receive event for start-task\" />\r\n\r\n        <sequenceFlow id=\'flow1\' \r\n            sourceRef=\'startWait\'\r\n            targetRef=\'checkForScheduledTime\'>\r\n             <extensionElements>\r\n               <!-- If the schedule date is null, publish should be performed immediatly. Gateway used the \'schedule\' boolean -->\r\n               <activiti:executionListener class=\"org.alfresco.repo.workflow.activiti.listener.ScriptExecutionListener\">\r\n                  <activiti:field name=\"script\">\r\n                     <activiti:string>\r\n                        // Check if the publish should be scheduled or performed immediatly\r\n                        if (typeof pubwf_scheduledPublishDate != \'undefined\' &amp;&amp; pubwf_scheduledPublishDate != null) {\r\n                           execution.setVariable(\"schedule\", true);\r\n                        } else {\r\n                           execution.setVariable(\"schedule\", false);\r\n                        } \r\n                     </activiti:string>\r\n                  </activiti:field>\r\n               </activiti:executionListener>\r\n               \r\n               <!-- Timer expects an ISO-8601 date, publish time should be converted (if present) -->\r\n               <activiti:executionListener class=\"org.alfresco.repo.workflow.activiti.listener.ConvertDateToISO8601\">\r\n                  <activiti:field name=\"source\" stringValue=\"pubwf_scheduledPublishDate\" />\r\n                  <activiti:field name=\"target\" stringValue=\"iso8601PublishDate\" />\r\n               </activiti:executionListener>\r\n             </extensionElements>\r\n        </sequenceFlow>\r\n\r\n        <exclusiveGateway  id=\"checkForScheduledTime\" name=\"Check Schedule\" /> \r\n\r\n        <sequenceFlow id=\'flow3\' sourceRef=\'checkForScheduledTime\' targetRef=\'waitForScheduledTime\' >\r\n            <conditionExpression xsi:type=\"tFormalExpression\">${schedule}</conditionExpression>\r\n        </sequenceFlow>\r\n\r\n        <sequenceFlow id=\'flow4\' \r\n        sourceRef=\'checkForScheduledTime\'\r\n            targetRef=\'publish\' />\r\n            \r\n        <serviceTask id=\"publish\" \r\n             name=\"My Java Service Task\" \r\n             activiti:class=\"org.alfresco.repo.workflow.activiti.script.AlfrescoScriptDelegate\">\r\n              <extensionElements>\r\n                  <activiti:field name=\"script\">\r\n                     <activiti:string>\r\n                        var publishEventAction = actions.create(\"pub_publishEvent\");\r\n                        publishEventAction.executeAsynchronously(pubwf_publishingEvent);\r\n                     </activiti:string>\r\n                  </activiti:field>\r\n              </extensionElements>\r\n         </serviceTask>\r\n         \r\n         <receiveTask id=\"waitForScheduledTime\" name=\"Wait for publish time\" />\r\n         \r\n         <boundaryEvent id=\"publishTimer\" cancelActivity=\"true\" attachedToRef=\"waitForScheduledTime\">\r\n             <timerEventDefinition>\r\n                 <timeDate>${iso8601PublishDate}</timeDate>\r\n             </timerEventDefinition>\r\n         </boundaryEvent>    \r\n         \r\n         <sequenceFlow id=\'flow5\' sourceRef=\'waitForScheduledTime\'\r\n            targetRef=\'end\' />\r\n            \r\n         <sequenceFlow id=\'flow6\' sourceRef=\'publishTimer\'\r\n            targetRef=\'publish\' /> \r\n        \r\n        <sequenceFlow id=\'flow7\' sourceRef=\'publish\'\r\n            targetRef=\'end\' />\r\n\r\n        <endEvent id=\"end\" />\r\n\r\n    </process>\r\n</definitions>',0),('3',1,'0e6d23fe-12ae-4127-8d5f-9ef9b6bd72f1activitiAdhoc.png','1','‰PNG\r\n\Z\n\0\0\0\rIHDR\0\0Û\0\0\0F\0\0\0„õ>\0\0w