ents>\r\n            <humanPerformer>\r\n                <resourceAssignmentExpression>\r\n                    <formalExpression>${bpm_assignee.properties.userName}</formalExpression>\r\n                </resourceAssignmentExpression>\r\n            </humanPerformer>\r\n        </userTask>\r\n\r\n        <sequenceFlow id=\'flow2\' \r\n        sourceRef=\'reviewTask\'\r\n            targetRef=\'reviewDecision\' />\r\n\r\n        <exclusiveGateway  id=\"reviewDecision\" name=\"Review Decision\" /> \r\n\r\n        <sequenceFlow id=\'flow3\' sourceRef=\'reviewDecision\' targetRef=\'approved\' >\r\n            <conditionExpression xsi:type=\"tFormalExpression\">${wf_reviewOutcome == \'Approve\'}</conditionExpression>\r\n        </sequenceFlow>\r\n\r\n        <sequenceFlow id=\'flow4\' \r\n        sourceRef=\'reviewDecision\'\r\n            targetRef=\'rejected\' />\r\n\r\n       <userTask id=\"approved\" name=\"Approved\"\r\n            activiti:formKey=\"wswf:approvedTask\" >\r\n            <extensionElements>\r\n               <activiti:taskListener event=\"create\" class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\r\n                  <activiti:field name=\"script\">\r\n                     <activiti:string>\r\n                     \r\n                        if (typeof bpm_workflowDueDate != \'undefined\') task.dueDate = bpm_workflowDueDate\r\n                        if (typeof bpm_workflowPriority != \'undefined\') task.priority = bpm_workflowPriority;\r\n                        \r\n                        var publishAction = actions.create(\"webqs_publish\");\r\n                        publishAction.execute(bpm_package);\r\n                        \r\n                     </activiti:string>\r\n                  </activiti:field>\r\n               </activiti:taskListener>\r\n            </extensionElements>\r\n            <humanPerformer>\r\n                <resourceAssignmentExpression>\r\n                    <formalExpression>${initiator.exists() ? initiator.properties.userName : \'admin\'}</formalExpression>\r\n                </resourceAssignmentExpression>\r\n            </humanPerformer>\r\n        </userTask>\r\n        \r\n        <userTask id=\"rejected\" name=\"Rejected\"\r\n            activiti:formKey=\"wswf:rejectedTask\" >\r\n            <extensionElements>\r\n               <activiti:taskListener event=\"create\" class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\r\n                  <activiti:field name=\"script\">\r\n                     <activiti:string>\r\n                        if (typeof bpm_workflowDueDate != \'undefined\') task.dueDate = bpm_workflowDueDate\r\n                        if (typeof bpm_workflowPriority != \'undefined\') task.priority = bpm_workflowPriority;\r\n                     </activiti:string>\r\n                  </activiti:field>\r\n               </activiti:taskListener>\r\n            </extensionElements>\r\n            <humanPerformer>\r\n                <resourceAssignmentExpression>\r\n                    <formalExpression>${initiator.exists() ? initiator.properties.userName : \'admin\'}</formalExpression>\r\n                </resourceAssignmentExpression>\r\n            </humanPerformer>\r\n        </userTask>\r\n\r\n        <sequenceFlow id=\'flow5\' sourceRef=\'approved\'\r\n            targetRef=\'end\' />\r\n\r\n        <sequenceFlow id=\'flow6\' sourceRef=\'rejected\'\r\n            targetRef=\'end\' />\r\n\r\n        <endEvent id=\"end\" />\r\n    </process>\r\n</definitions>',0),('34',1,'332928c9-01cc-46cf-b7c3-27cf2f5a65b6bpmn20.xml','33','<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\r\n\r\n<definitions xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\r\n   xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:activiti=\"http://activiti.org/bpmn\"\r\n   xmlns:bpmndi=\"http://www.omg.org/spec/BPMN/20100524/DI\" xmlns:omgdc=\"http://www.omg.org/spec/DD/20100524/DC\"\r\n   xmlns:omgdi=\"http://www.omg.or